import React from 'react';
import './burger-menu.css';

const BurgerMenu = ({onBtnClickHandler, menu}) => {
    
    return (
        <div className="burger-menu__button" onClick={onBtnClickHandler}>
            {menu}
        </div>
    )
};
export default BurgerMenu;
